{'message': '你不用再每天五六点钟爬起来，一边吃早饭一边迷迷糊糊往教室跑，你不用偷偷么么上课玩手机怕被老师抓到，你不用再每天的某节课情不自禁地睡过去。你不用把篮球杂志藏在历史课本后面小心翼翼地看完，你不用挖空心思想办法骗一张假条，你不用每天熬夜到凌晨做习题。你不用再为每一次的考试郁闷不已，那个过去的梦想无论完美与否，你似乎都实现了它。

你不必再盼望一个可以睡懒觉的周末，因为你每天都可以睡到艳阳高照，你每天可以打通宵游戏，然后在任意一节课上补觉。你不必再抱着手机看图文直播，因为你可以翘掉任意一节课去看比赛。你不用再为课桌上一沓一沓的教案和试卷犯愁，因为你只需要临考前狂背两个星期就可以及格。你不用再偷偷地躲在被窝里看电影，因为你电脑里存了不下于两百部电影。你不用害怕班主任突然在教室的后面出现，因为你连辅导员都没见过几次，可是然后呢，然后呢，然后呢？

你每天按时吃饭，再也不会和同桌偷偷分零食吃了，再也不会晚自习偷偷跑出去喝酒了。你的周围也不再是满满当当的课本了，你再也没有机会在安静的晚自习和课堂上和周围的人聊天吹牛了，你不会下课和几个死党勾肩搭背一起去厕所。你不会再在走廊里背基本能力可以天光大亮了，你不会回到宿舍和舍友聊天到午夜直到被宿管通报了，你不用再躲在洗手间抽烟了。你遇到无数的漂亮光鲜的姑娘，却再也没有那么一个人让你怦然心动了，你不用等到有时间才可以接电话，你不用绕过几间教室装作不经意的看那个可爱女生一眼。你有了大把的时间，认识了大把的异性，却越来越没有了恋爱的勇气和冲动，你再也不会为了一个人整整不眠到天明，你再也不会为了一个人酩酊大醉，再也不会为一个人痛哭流涕刻骨铭心。这一段，你只能留下，带不走。', 'plat': 0, 'device': ''}

{'message': '你遇到无数可以一起喝酒的人，却再也没有几个人和你形影不留，你越来越能喝酒，越来越能喝醉，你再也没有机会和几个狐朋狗友勾肩搭背的喝得醉醺醺的回宿舍，再也没有机会和几个死党喝酒到天明。你认识了形形色色各种各样的人，却再也没有几个和你谈人生谈理想，掏心掏肺、生死与共。你再也找不到一群可以随时随地一起组队的好球友，也再也没有人和你在球场上相互取笑，你再也不会溜达过半栋教学楼，只为给哥们讲一个笑话。你再也不用和一堆家伙分享篮球杂志，篮球报纸，可是你再也没买过。这一段你只能留下，带不走。

你每堂课都换一片前后左右桌，你谁是可以打电话发短信你再也不用惊动大半个班的人，只为传一张没什么要紧事的小纸条。你每一天都可以翻阅无数的网游修仙玄幻校园青春小说，却再也没有提笔写下些什么的冲动，你每天早早的回到宿舍却除了对着电脑上网，再也没有聊到天亮的激情。你认识了数不清的男男女女，却再也没有轻易寄存心事的那种信任。这一段，你只能留下，带不走。

你开始喜欢陈奕迅，喜欢怀旧，喜欢一些那些年觉得很土的歌，你听《同桌的你》《童年》，听到悲从中来，泪流满面。你终于听懂了那些年不曾领悟的东西，却再也难以倾诉，你看《老男孩》，看《那些年我们一起追的女孩》，看《初恋这件小事》，你用一切可以缅怀的方式缅怀过去，可是过去了就再也回不去。你常常因为一首歌一部电影感慨良多，黯然神伤，那些打动你的某些歌词，某个镜头却都如同你的心酸委屈孤单的埋在心里，你再也找不到一个可以一回头就可以与他分享的那个人，这些你只能孤独承受。', 'plat': 0, 'device': ''}

