{'message': '我忽然觉得不知道该说啥了;w;
女主人公千代子在十六岁偶然见到一个年轻的画家并且救了他,情窦初开,但是迫于现实压力两人并未相处却匆匆分别,画家临走时交给了千代子一枚钥匙,并约定二人再次相见.
可是造化弄人,千代子穷尽一生年华追寻的不过是一个虚幻的背影,这位画家早早就在监狱中被审讯致死,而毫不知情的千代子却一直在追寻那个人的步伐做着幻想,甚至为了这个人而没有得到本来应该得到的幸福忽视了身边的人...
最后的千代子都没有得知真相,可是不知道真相反而对千代子才是好的,毕竟这个人他追逐了一生,所以最后让她抱着这个美好的幻想去世也不失为一种幸福(´；ω；`)
可是作者,这真是太致郁,还不能找你谈人生你这是叫我要如何是好（/TДT)/
最后的一句,我很喜欢那个追寻着你的我;w;', 'plat': 0, 'device': ''}

